  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116714 includes chemical,
  physical and time series data collected from MOORINGS in the Gulf of Alaska from
  2011-05-19 to 2013-09-25. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, CARBON DIOXIDE - AIR, OXYGEN - PERCENT SATURATION,
  Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE.
  The instruments used to collect these data include Bubble type equilibrator for
  autonomous carbon dioxide (CO2) measurement, Carbon dioxide (CO2) gas analyzer,
  Humidity Sensor, oxygen meter and thermosalinographs.nnThese data were collected
  by Jeremy Mathis, Adrienne Sutton, Christopher Sabine, Sylvia Musielewicz and Stacy
  Maenner of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of
  the Mooring_GAKOA_149W_60N_Mar2013_Sep2013, Mooring_GAKOA_149W_60N_May2011_Sep2011
  and Mooring_GAKOA_149W_60N_Sep2011_Dec2011 data set. CDIAC assigned the following
  cruise ID(s) to this data set: GAKO20110519, GAKO20110915 and GAKO20130307.nnThe
  Global CO2 Time-series and Moorings Project involves international groups from 18
  countries who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
